import { useEffect } from "react";
import { useDispatch } from "react-redux";
import { getLogs } from "../../actions/logs";

const LogItem = ({log}, key) => {
    const dispatch = useDispatch()
    
    return (
    <tr key={key}>
        <td>{log.subjtype}</td>
        <td>{log.subjid}</td>
        <td>{log.act}</td>
        <td>{log.objtype}</td>
        <td>{log.objid}</td>
    </tr>
    );
};

export default LogItem ;
